            "tiles/playlist_tile.html": '<div class="item">  <div class="tile-top">    <div class="tilt-container">      <div class="shadow-container"></div>      <div class="video-thumb $image singlethumb" data-image-url="{{model.imageUrl}}"></div>      <div class="collage-thumbnail hidden"></div>      <div class="overlay">        <div class="count">{{model.videoCountText}}</div>      </div>      <div class="show-overlay hidden">        <div class="show-text">{{model.showText}}</div>      </div>      <div class="mask">        <div class="sheen"></div>      </div>    </div>  </div>  <div class="tile-bottom">    <div class="title">{{model.title}}</div>    <div class="details">      <div class="subtitle">{{model.channel.displayName}}</div>      <div class="age">{{model.uploadedDateLabel}}</div>    </div>    <div class="long-byline">{{model.longBylineText}}</div>    <div class="yto-bottom-badge hidden"></div>  </div></div>',
